import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

function Header() {
  return (
    <header className="header">
      <h1>Student Management</h1>
      <nav>
        <Link to="/dashboard">Dashboard</Link>
        <Link to="/add">Add Student</Link>
      </nav>
    </header>
  );
}

export default Header;
